import React from "react";
import { Box, Typography, Link, Container } from "@mui/material";


const Footer = () => {
  return (
    <Box
      sx={{
        height: "20vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        bottom: 0
      }}
      color='primary'
    >
      <Container maxWidth='md'>

      </Container>
    </Box>
  );
};

export default Footer;
